import React from 'react';
import { Container, Typography, Grid, Card, CardContent } from '@mui/material';

type Exercise = {
  name: string;
  description: string;
  videoUrl: string;
};

type WorkoutPlan = {
  ectomorph: Exercise[];
  mesomorph: Exercise[];
  endomorph: Exercise[];
};

const workouts: WorkoutPlan = {
  ectomorph: [
    { name: 'Push Ups', description: 'Do 3 sets of 15 push-ups.', videoUrl: 'https://www.youtube.com/embed/d2XkS0yx_j0' },
    { name: 'Pull Ups', description: 'Do 3 sets of 10 pull-ups.', videoUrl: 'https://www.youtube.com/embed/eGo4IYlbE5g' },
    { name: 'Deadlift', description: '3 sets of 8 repetitions.', videoUrl: 'https://www.youtube.com/embed/op9kVnSso6Q' },
  ],
  mesomorph: [
    { name: 'Squats', description: 'Do 3 sets of 20 squats.', videoUrl: 'https://www.youtube.com/embed/aclHkVaku9U' },
    { name: 'Lunges', description: 'Do 3 sets of 12 lunges on each leg.', videoUrl: 'https://www.youtube.com/embed/QOVaHwm-Q6U' },
    { name: 'Bench Press', description: '3 sets of 10 repetitions.', videoUrl: 'https://www.youtube.com/embed/gRVjAtPip0Y' },
  ],
  endomorph: [
    { name: 'Plank', description: 'Hold the plank for 1 minute.', videoUrl: 'https://www.youtube.com/embed/pSHjTRCQxIw' },
    { name: 'Jumping Jacks', description: 'Do 3 sets of 30 jumping jacks.', videoUrl: 'https://www.youtube.com/embed/iQvG5RoS4lU' },
    { name: 'Burpees', description: '3 sets of 15 burpees.', videoUrl: 'https://www.youtube.com/embed/JZQA08SlJnM' },
  ],
};

interface WorkoutProps {
  bodyType: 'ectomorph' | 'mesomorph' | 'endomorph';
}

const Workout: React.FC<WorkoutProps> = ({ bodyType }) => {
  return (
    <Container 
      sx={{ color: '#fff', backgroundColor: 'rgba(0, 0, 0, 0.7)', padding: '20px', borderRadius: '10px' }}
    >
      <Typography variant="h4" gutterBottom>
        Workout Plan for {bodyType.charAt(0).toUpperCase() + bodyType.slice(1)}
      </Typography>

      <Grid container spacing={3}>
        {workouts[bodyType].map((exercise: Exercise, index: number) => (
          <Grid item xs={12} sm={6} key={index}>
            <Card>
              <CardContent>
                <Typography variant="h6">{exercise.name}</Typography>
                <Typography>{exercise.description}</Typography>
                <iframe
                  width="100%"
                  height="200"
                  src={exercise.videoUrl}
                  title={exercise.name}
                  allowFullScreen
                />
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Workout;
